create table pcr_applicant_info
(
    id             varchar(64)  not null comment '主键ID',
    order_id       varchar(64)  null comment '订单流水号',
    serial_id      varchar(64)  null comment '数据流水号',
    etl_id         varchar(64)  null comment '清洗流水号',
    report_id      varchar(32)  null comment '报告编号',
    applicant_name varchar(90)  null comment '被查询者姓名',
    id_code        varchar(60)  null comment '被查询者证件类型',
    id_card_no     varchar(32)  null comment '被查询者证件号码',
    org_no         varchar(600) null comment '查询机构代码',
    cause_code     varchar(60)  null comment '查询原因代码',
    create_time    datetime     not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'A_02-本次查询请求信息' engine = InnoDB;

create index idx_etl_report
    on pcr_applicant_info (etl_id, report_id);

